  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `examination_id` bigint unsigned NOT NULL,
  `script_id` bigint unsigned NOT NULL,
  `number` tinyint NOT NULL DEFAULT '1',
  `sorting_mode` enum('Normal','Random') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'Normal',
  `control_mode` tinyint(1) NOT NULL DEFAULT '0',
  `auto_next` tinyint(1) NOT NULL DEFAULT '0',
  `replacement_duration` int NOT NULL DEFAULT '0',
  `duration` decimal(7,0) NOT NULL DEFAULT '0',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `sections_examination_id_foreign` (`examination_id`),
  KEY `sections_script_id_foreign` (`script_id`),
  CONSTRAINT `sections_examination_id_foreign` FOREIGN KEY (`examination_id`) REFERENCES `examinations` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `sections_script_id_foreign` FOREIGN KEY (`script_id`) REFERENCES `scripts` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

