DROP VIEW IF EXISTS `v_points`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_points` AS select `a`.`id` AS `answer_id`,`ps`.`id` AS `participant_section_id`,`ps`.`participant_id` AS `participant_id`,`q`.`number` AS `number`,`p`.`age` AS `age`,`s`.`examination_id` AS `examination_id`,`sc`.`category_id` AS `category_id`,`sc`.`sub_category_id` AS `sub_category_id`,`a`.`question_id` AS `question_id`,`c`.`name` AS `category_name`,`c2`.`name` AS `sub_category_name`,`sc`.`type` AS `type`,(select group_concat(`choices`.`key` separator ',') from (`answer_choices` join `choices` on((`choices`.`id` = `answer_choices`.`choice_id`))) where (`answer_choices`.`answer_id` = `a`.`id`) group by `answer_choices`.`answer_id`) AS `choice_key`,(select group_concat(coalesce(`choices`.`key`,`answer_choices`.`answer`) separator ',') from (`answer_choices` left join `choices` on((`choices`.`id` = `answer_choices`.`choice_id`))) where (`answer_choices`.`answer_id` = `a`.`id`) group by `answer_choices`.`answer_id`) AS `answers`,(case when (`sc`.`type` in ('Single','Multiple')) then coalesce((select `s`.`value` from `scores` `s` where ((`s`.`question_id` = `a`.`question_id`) and ((select json_arrayagg(`cs`.`choice_id`) from `choice_score` `cs` where (`cs`.`score_id` = `s`.`id`)) = (select json_arrayagg(`ac`.`choice_id`) from `answer_choices` `ac` where (`ac`.`answer_id` = `a`.`id`))))),0) else coalesce((select `s`.`value` from `scores` `s` where ((`s`.`question_id` = `a`.`question_id`) and ((select json_arrayagg(lower(trim(`c`.`content`))) from (`choice_score` `cs` join `choices` `c` on((`c`.`id` = `cs`.`choice_id`))) where (`cs`.`score_id` = `s`.`id`)) = (select json_arrayagg(lower(trim(`ac`.`answer`))) from `answer_choices` `ac` where (`ac`.`answer_id` = `a`.`id`))))),0) end) AS `score` from (((((((`answers` `a` join `participant_sections` `ps` on((`ps`.`id` = `a`.`participant_section_id`))) left join `participants` `p` on((`p`.`id` = `ps`.`participant_id`))) join `sections` `s` on((`s`.`id` = `ps`.`section_id`))) join `scripts` `sc` on((`sc`.`id` = `s`.`script_id`))) join `questions` `q` on((`q`.`id` = `a`.`question_id`))) left join `categories` `c` on((`c`.`id` = `sc`.`category_id`))) left join `sub_categories` `c2` on((`c2`.`id` = `sc`.`sub_category_id`)));

